import React from 'react';
import { Navbar as BSNavbar, Nav, Button, Container } from 'react-bootstrap';
import { useNavigate } from 'react-router-dom';
import { PersonCircle, BoxArrowRight, House } from 'react-bootstrap-icons';
import { toast } from 'react-toastify';
import authService from '../../services/authService';

const Navbar = () => {
    const navigate = useNavigate();
    const adminInfo = authService.getAdminInfo();

    const handleLogout = async () => {
        if (window.confirm('Are you sure you want to logout?')) {
            try {
                await authService.logout();
                toast.success('Logged out successfully');
                navigate('/login');
            } catch (error) {
                console.error('Logout error:', error);
                // Clear local storage anyway
                authService.logout();
                navigate('/login');
            }
        }
    };

    return (
        <BSNavbar bg="primary" variant="dark" expand="lg" className="shadow-sm">
            <Container fluid>
                <BSNavbar.Brand href="/admin" className="d-flex align-items-center">
                    <House className="me-2" />
                    <strong>B2World Interview System</strong>
                </BSNavbar.Brand>
                
                <BSNavbar.Toggle aria-controls="basic-navbar-nav" />
                
                <BSNavbar.Collapse id="basic-navbar-nav">
                    <Nav className="me-auto">
                        <Nav.Link href="/admin" className="fw-semibold">
                            Dashboard
                        </Nav.Link>
                    </Nav>
                    
                    <Nav className="d-flex align-items-center">
                        <span className="text-light me-3 d-flex align-items-center">
                            <PersonCircle className="me-2" />
                            Welcome, <strong className="ms-1">{adminInfo?.Username || 'Admin'}</strong>
                        </span>
                        
                        <Button 
                            variant="outline-light" 
                            size="sm"
                            onClick={handleLogout}
                            className="d-flex align-items-center"
                        >
                            <BoxArrowRight className="me-1" />
                            Logout
                        </Button>
                    </Nav>
                </BSNavbar.Collapse>
            </Container>
        </BSNavbar>
    );
};

export default Navbar;
